import { useEffect } from 'react';

const Adv = () => {
    useEffect(() => {
        window.googletag = window.googletag || {cmd: []};
        window.googletag.cmd.push(function () {
            window.googletag.pubads().disableInitialLoad(); // Disable initial ad load
        });

        // Define ad slots
        window.googletag.cmd.push(function () {
            const adSlot = window.googletag.defineSlot('/1234567/sports', [300, 250], 'ad-slot-id');
            adSlot.addService(window.googletag.pubads());

            // Set targeting (if needed)
            // adSlot.setTargeting('custom', 'targeting_value');

            // Enable services
            window.googletag.enableServices();

            // Display the ad


            // Start loading ads
            window.googletag.pubads().refresh(); // Initial ad load
        }, [])
    });

    return (
        <div>
            <div id="ad-slot-id" style={{ width: '300px', height: '250px' }}>
                {/* This is the ad container */}
            </div>
        </div>
    );
}

export default Adv;
